package expression.generic;import java.util.Objects;public class UncheckedIntegerMode implements NumberMode<Integer> {    @Override    public Integer parse(String string) {        return Integer.parseInt(string);    }    @Override    public Integer add(Integer a, Integer b) {        return a + b;    }    @Override    public Integer subtract(Integer a, Integer b) {        return a - b;    }    @Override    public Integer multiply(Integer a, Integer b) {        return a * b;    }    @Override    public Integer divide(Integer a, Integer b) {        return a / b;    }    @Override    public Integer min(Integer a, Integer b) {        return Integer.min(a, b);    }    @Override    public Integer max(Integer a, Integer b) {        return Integer.max(a, b);    }    @Override    public Integer negate(Integer a) {        return -a;    }    @Override    public int intValue(Integer a) {        return a;    }    @Override    public boolean compare(Integer a, Integer b) {        return Objects.equals(a, b);    }    @Override    public Integer count(Integer a) {        return Integer.bitCount(a);    }}